var fileJSON=[{"path":"/glob/development-tools/versions/oneapi/gold/inteloneapi/dev-utilities/2021.1.1/include/dpc_common.hpp", "name":"dpc_common.hpp", "has_active_debug_locs":false, "absName":"/glob/development-tools/versions/oneapi/gold/inteloneapi/dev-utilities/2021.1.1/include/dpc_common.hpp", "content":"//==============================================================\012// Copyright  2020 Intel Corporation\012//\012// SPDX-License-Identifier: MIT\012// =============================================================\012\012#ifndef _DP_HPP\012#define _DP_HPP\012\012#pragma once\012\012#include <stdlib.h>\012#include <exception>\012\012#include <CL/sycl.hpp>\012\012namespace dpc_common {\012// this exception handler with catch async exceptions\012static auto exception_handler = [](cl::sycl::exception_list eList) {\012  for (std::exception_ptr const &e : eList) {\012    try {\012      std::rethrow_exception(e);\012    } catch (std::exception const &e) {\012#if _DEBUG\012      std::cout << \"Failure\" << std::endl;\012#endif\012      std::terminate();\012    }\012  }\012};\012\012// The TimeInterval is a simple RAII class.\012// Construct the timer at the point you want to start timing.\012// Use the Elapsed() method to return time since construction.\012\012class TimeInterval {\012 public:\012  TimeInterval() : start_(std::chrono::steady_clock::now()) {}\012\012  double Elapsed() {\012    auto now = std::chrono::steady_clock::now();\012    return std::chrono::duration_cast<Duration>(now - start_).count();\012  }\012\012 private:\012  using Duration = std::chrono::duration<double>;\012  std::chrono::steady_clock::time_point start_;\012};\012\012};  // namespace dpc_common\012\012#endif\012"}, {"path":"/home/u58822/One-API/oneAPI-samples/DirectProgramming/DPC++FPGA/Tutorials/Features/max_concurrency/build/src/max_concurrency.cpp", "name":"max_concurrency.cpp", "has_active_debug_locs":false, "absName":"/home/u58822/One-API/oneAPI-samples/DirectProgramming/DPC++FPGA/Tutorials/Features/max_concurrency/build/src/max_concurrency.cpp", "content":"//==============================================================\012// Copyright Intel Corporation\012//\012// SPDX-License-Identifier: MIT\012// =============================================================\012#include <CL/sycl.hpp>\012#include <CL/sycl/INTEL/fpga_extensions.hpp>\012#include <array>\012#include <iomanip>\012#include <iostream>\012\012// dpc_common.hpp can be found in the dev-utilities include folder.\012// e.g., $ONEAPI_ROOT/dev-utilities//include/dpc_common.hpp\012#include \"dpc_common.hpp\"\012\012using namespace sycl;\012\012constexpr size_t kSize = 8192;\012constexpr size_t kMaxIter = 50000;\012constexpr size_t kTotalOps = 2 * kMaxIter * kSize;\012constexpr size_t kMaxValue = 128;\012\012using FloatArray = std::array<float, kSize>;\012using FloatScalar = std::array<float, 1>;\012\012template <int concurrency> class Kernel;\012\012// Launch a kernel on the device specified by selector.\012// The kernel's functionality is designed to show the\012// performance impact of the max_concurrency attribute.\012template <int concurrency>\012void PartialSumWithShift(const device_selector &selector,\012                         const FloatArray &array, float shift,\012                         FloatScalar &result) {\012  double kernel_time = 0.0;\012\012  try {\012\012    queue q(selector, dpc_common::exception_handler,\012            property::queue::enable_profiling{});\012\012    buffer buffer_array(array);\012    buffer<float, 1> buffer_result(result.data(), 1);\012\012    event e = q.submit([&](handler &h) {\012      accessor accessor_array(buffer_array, h, read_only);\012      accessor accessor_result(buffer_result, h, write_only, noinit);\012\012      h.single_task<Kernel<concurrency>>([=]()\012                                          [[intel::kernel_args_restrict]] {\012        float r = 0;\012\012        // At most concurrency iterations of the outer loop will be\012        // active at one time.\012        // This limits memory usage, since each iteration of the outer\012        // loop requires its own copy of a1.\012        [[intel::max_concurrency(concurrency)]]\012        for (size_t i = 0; i < kMaxIter; i++) {\012          float a1[kSize];\012          for (size_t j = 0; j < kSize; j++)\012            a1[j] = accessor_array[(i * 4 + j) % kSize] * shift;\012          for (size_t j = 0; j < kSize; j++)\012            r += a1[j];\012        }\012        accessor_result[0] = r;\012      });\012    });\012\012    // SYCL event profiling allows the kernel execution to be timed\012    double start = e.get_profiling_info<info::event_profiling::command_start>();\012    double end = e.get_profiling_info<info::event_profiling::command_end>();\012    kernel_time = (double)(end - start) * 1e-6;\012\012  } catch (sycl::exception const &e) {\012    // Catches exceptions in the host code\012    std::cerr << \"Caught a SYCL host exception:\\n\" << e.what() << \"\\n\";\012\012    // Most likely the runtime couldn't find FPGA hardware!\012    if (e.get_cl_code() == CL_DEVICE_NOT_FOUND) {\012      std::cerr << \"If you are targeting an FPGA, please ensure that your \"\012                   \"system has a correctly configured FPGA board.\\n\";\012      std::cerr << \"Run sys_check in the oneAPI root directory to verify.\\n\";\012      std::cerr << \"If you are targeting the FPGA emulator, compile with \"\012                   \"-DFPGA_EMULATOR.\\n\";\012    }\012    std::terminate();\012  }\012\012  // The performance of the kernel is measured in GFlops, based on:\012  // 1) the number of floating-point operations performed by the kernel.\012  //    This can be calculated easily for the simple example kernel.\012  // 2) the kernel execution time reported by SYCL event profiling.\012  std::cout << \"Max concurrency \" << concurrency << \" \"\012            << \"kernel time : \" << kernel_time << \" ms\\n\";\012  std::cout << \"Throughput for kernel with max_concurrency \" << concurrency\012            << \": \";\012  std::cout << std::fixed << std::setprecision(3)\012            << ((double)(kTotalOps) / kernel_time) / 1e6f << \" GFlops\\n\";\012}\012\012// Calculates the expected results. Used to verify that the kernel\012// is functionally correct.\012float GoldenResult(const FloatArray &A, float shift) {\012  float gr = 0;\012  for (size_t i = 0; i < kMaxIter; i++) {\012    float a1[kSize];\012    for (size_t j = 0; j < kSize; j++)\012      a1[j] = A[(i * 4 + j) % kSize] * shift;\012    for (size_t j = 0; j < kSize; j++)\012      gr += a1[j];\012  }\012  return gr;\012}\012\012int main() {\012  bool success = true;\012\012  FloatArray A;\012  FloatScalar R0, R1, R2, R3, R4, R5;\012\012  float shift = (float)(rand() % kMaxValue);\012\012  // initialize the input data\012  for (size_t i = 0; i < kSize; i++)\012    A[i] = rand() % kMaxValue;\012\012#if defined(FPGA_EMULATOR)\012  INTEL::fpga_emulator_selector selector;\012#else\012  INTEL::fpga_selector selector;\012#endif\012\012  // Run the kernel with different values of the max_concurrency\012  // attribute, to determine the optimal concurrency.\012  // In this case, the optimal max_concurrency is 2 since this\012  // achieves the highest GFlops. Higher values of max_concurrency\012  // consume additional RAM without increasing GFlops.\012  PartialSumWithShift<0>(selector, A, shift, R0);\012  PartialSumWithShift<1>(selector, A, shift, R1);\012  PartialSumWithShift<2>(selector, A, shift, R2);\012  PartialSumWithShift<4>(selector, A, shift, R3);\012  PartialSumWithShift<8>(selector, A, shift, R4);\012  PartialSumWithShift<16>(selector, A, shift, R5);\012\012  // compute the actual result here\012  float gr = GoldenResult(A, shift);\012\012  // verify the results are correct\012  if (gr != R0[0]) {\012    std::cout << \"Max Concurrency 0: mismatch: \" << R0[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (gr != R1[0]) {\012    std::cout << \"Max Concurrency 1: mismatch: \" << R1[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (gr != R2[0]) {\012    std::cout << \"Max Concurrency 2: mismatch: \" << R2[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (gr != R3[0]) {\012    std::cout << \"Max Concurrency 4: mismatch: \" << R3[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (gr != R4[0]) {\012    std::cout << \"Max Concurrency 8: mismatch: \" << R4[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (gr != R5[0]) {\012    std::cout << \"Max Concurrency 16: mismatch: \" << R5[0] << \" != \" << gr\012              << \" (kernel != expected)\" << '\\n';\012    success = false;\012  }\012\012  if (success) {\012    std::cout << \"PASSED: The results are correct\\n\";\012    return 0;\012  }\012\012  return 1;\012}\012"}];
